import React from "react";

const DisplayCounter = ({ count, onIncrement }) => {
  return (
    <div>
      <h1>DisplayCounter</h1>
      <p>Count: {count}</p>
      <button onClick={onIncrement}>Increment</button>
      <hr />
      <hr />
    </div>
  );
};

export default DisplayCounter;
